import { styled } from '@mui/material/styles';
import { TextField } from '@mui/material';

const Search = styled(TextField)(({ theme }) => ({
    borderRadius: '8px',
    backgroundColor: '#CCC',
    marginLeft: 0,
    width: '60px',
    height:'24px'
  }));
  


export default Search
